今週の手作りおやつはエクレール。

前回チョコレートクリームで作ったら、試食担当(←オット)から、次はカスタードがいいとリクエストがあったので今回はカスタードバージョンで。それ以外は以前作ったものと同じ。

焼き上がったシュー生地を見て、あれ？こんなだったかな？？？としばしシュー生地を見て……使う小麦粉を間違えていたことに気づく。そのシューをかじりながら作り直し。やっぱり見た目も食感も全然違うわーと、失敗からの学び。
失敗作はエクレールにはなれないけど、コーヒーのお供には十分なので冷凍庫行き。そのままでも美味しいけどコンフィチュールとかピーナッツバターを塗ってもいいな。

カスタードは卵黄たくさんの濃厚リッチなクリーム😋

